import React from 'react';
import './NotFound.css';
import image from '../../404.png';

const NotFound = () => (
    <div className="NotFound">
        <h1>Sorry, that page was not found!</h1>
        <br/>
        <div className="image">
            <img src={image} alt="404-error" width="100%" />
        </div>
    </div>
);

export default NotFound;
